import React from 'react'
import './Footer.scss'

const Footer = () => {
    const d = new Date();
    return (
        <footer>
            <div className='footer'>
                <a href='/'>EarHealth</a> &#169; {d.getFullYear()} |
                <a href='privacy-policy'>Privacy Policy</a>
            </div>
        </footer>
    )
}

export default Footer
